import React from 'react';

import './SideNav.css'
import Shell from '@react/react-spectrum/SideNav'

export default class ProtoSideNav extends React.Component {
    render(){
      return (
          <div>
              <nav id="react-spectrum-113" class="react-spectrum-SideNav"><ul class="spectrum-SideNav" id="react-spectrum-113-list"><li class="spectrum-SideNav-item is-selected" target="_self"><a tabindex="0" class="spectrum-SideNav-itemLink is-selected" id="react-spectrum-114" role="link" aria-current="page" target="_self">Foo</a></li><li class="spectrum-SideNav-item is-disabled" target="_self"><a class="spectrum-SideNav-itemLink is-disabled" id="react-spectrum-115" role="link" aria-disabled="true" target="_self">Baz</a></li><li class="spectrum-SideNav-item" target="_self"><a tabindex="0" class="spectrum-SideNav-itemLink" id="react-spectrum-116" role="link" target="_self">Test</a></li><li class="spectrum-SideNav-item" target="_self"><a tabindex="0" class="spectrum-SideNav-itemLink" id="react-spectrum-117" role="link" target="_self">Hi</a></li></ul></nav>
          </div>

      )
    }
  }
